import React, { Component, Fragment } from 'react';
import { MenuBar, MenuItem } from './About.styled.js';

class About extends Component {
  constructor(props){
    super(props);
    this.state={
      selectedView: 'aboutWren'
    };

    this.menuItemOnClick = this.menuItemOnClick.bind(this);
  }

  menuItemOnClick(target) {
    this.setState({ selectedItem: target });
  }

  render() {
    return (
      <Fragment>
        <MenuBar>
          <MenuItem
            onClick={() => this.menuItemOnClick('aboutWren')}
            selected={this.state.selectedItem === 'aboutWren'}
          >HOME</MenuItem>
          <MenuItem>Coaching History</MenuItem>
          <MenuItem>Coaching Style</MenuItem>
        </MenuBar>
      </Fragment>
    );
  }
}

export default About;
